def common_characters(strings):
    count = {}
    common = ''
    for string in strings:
        current = {}
        for char in string:
            if char not in current:
                current[char] = 0
            current[char] += 1
        for char, freq in current.items():
            if char in count and count[char] < freq:
                count[char] = freq
            elif char not in count:
                count[char] = freq
        for char, freq in count.items():
            if freq == string.count(char):
                common += char
    return common
